import React from "react";
import styled from "styled-components";
import {colorsRoles} from "../../../01 Atoms/Colors";
import Test from "../../../../media/img/Projects/02_Creative Developer/ToDoList.png";
import {fonts} from "../../../01 Atoms/globalStyle";


const CodeSandBoxItem = () => {
    return <>
        <Wrapper href={"https://codesandbox.io/s/lucid-colden-08mq3"}>
            <img src={Test} alt={"CodeSandBox Preview"}/>
            <Label><p>Button Component</p></Label>
        </Wrapper>
    </>

};

export default CodeSandBoxItem;

export const Wrapper = styled.a`
display: block;
position: relative;
width: 240px;
height: 160px;
background-color: ${colorsRoles.DarkGrey};
border-radius: 16px 16px 0 0;
overflow: hidden;
cursor: pointer;

& img {
width: 100%;
}

`;

export const Label = styled.div`
width: 100%;
height: 32px;
background-color: ${colorsRoles.DarkGrey};
display: flex;
justify-content: center;
align-items: center;

    & p {
        ${fonts.Roboto};
        font-weight: bold;
        font-size: 2rem;
        color: ${colorsRoles.White};
    }
`;
